import React from 'react'

const Settings = () => {
  function changeCSS () {
    this.setState({stylePath: 'App.css'})
  }

  return (
    <div class="settings-page">
        <div class="company-section">
            <h1>Settings</h1>
            <body>
                Color Scheme:<br/> <button onClick={changeCSS}>change</button>
            </body>
        </div>
    </div>
  )
}

export default Settings
